import React from 'react'

function Login() {
  return (
    <>
      <nav class="navbar">
        <div class="container">
          <a class="navbar-brand" href="#">
            <img src="https://img.icons8.com/?size=100&id=baTWeZAqG8lF&format=png&color=000000" alt="" width="50" height="54" />
            {/* Logo */}
          </a>
        </div>
      </nav>


      
    </>
  )
}

export default Login
